public Query getCompanyAddressQuery()
{
    Query query = new Query();
    QueryBuildDataSource qDataSource;
    qDataSource = query.addDataSource(tableNum(LogisticsPostalAddress));
    qDataSource = qDataSource.addDataSource(tableNum(DirPartyLocation));
    qDataSource.joinMode(JoinMode::ExistsJoin);
    qDataSource.addLink(fieldNum(LogisticsPostalAddress, Location), fieldNum(DirPartyLocation, Location));
    qDataSource.addRange(fieldNum(DirPartyLocation, Party)).value(queryValue(CompanyInfo::current()));
    return query;
}

