}

public void updateDeclarer()
{
    switch (taxReport770Table_IT.DeclarerType)
    {
        case DeclarerType_IT::SameLegalEntity:
            if (taxReport770Table_IT.EditorialComments == Taxreport770EditorialComments_IT::SectionIII
                || taxReport770Table_IT.EditorialComments == Taxreport770EditorialComments_IT::SectionIV)
            {
                declarer_DeclarerFiscalCode.allowEdit(true);
            }
            else
            {
                declarer_DeclarerFiscalCode.allowEdit(false);
            }
            taxReport770Table_IT.DeclarerFiscalCode = '';
            declarer_CAFInscriptionNumber.allowEdit(false);
            taxReport770Table_IT.cafInscriptionNumber = '';
            declarer_CAFObligation.allowEdit(false);
            declarer_CAFFiscalCode.allowEdit(false);
            taxReport770Table_IT.cafFiscalCode = '';
            declarer_CAFTransmissionDate.allowEdit(false);
            taxReport770Table_IT.cafTransmissionDate = dateNull();
            break;

        case DeclarerType_IT::OtherLegalEntity:
            declarer_DeclarerFiscalCode.allowEdit(true);
            declarer_CAFInscriptionNumber.allowEdit(false);
            taxReport770Table_IT.cafInscriptionNumber = '';
            declarer_CAFObligation.allowEdit(true);
            declarer_CAFFiscalCode.allowEdit(false);
            taxReport770Table_IT.cafFiscalCode = '';
            declarer_CAFTransmissionDate.allowEdit(true);
            taxReport770Table_IT.cafTransmissionDate = dateNull();

            break;
        case DeclarerType_IT::CAF:
            declarer_DeclarerFiscalCode.allowEdit(true);
            declarer_CAFInscriptionNumber.allowEdit(true);
            declarer_CAFObligation.allowEdit(true);
            declarer_CAFFiscalCode.allowEdit(true);
            declarer_CAFTransmissionDate.allowEdit(true);

            break;

        default:
            declarer_DeclarerFiscalCode.allowEdit(false);
            taxReport770Table_IT.DeclarerFiscalCode = '';
            declarer_CAFInscriptionNumber.allowEdit(false);
            taxReport770Table_IT.cafInscriptionNumber = '';
            declarer_CAFObligation.allowEdit(false);
            declarer_CAFFiscalCode.allowEdit(false);
            taxReport770Table_IT.cafFiscalCode = '';
            declarer_CAFTransmissionDate.allowEdit(false);
            taxReport770Table_IT.cafTransmissionDate = dateNull();

            break;
    }
}

private void enableCorrectedDeclaration()
{
    ReportInfo1_CorrectedDeclaration.allowEdit(
        taxReport770Table_IT.DeclarationType == TaxReport770DeclarationType_IT::Corrective
        || taxReport770Table_IT.DeclarationType == TaxReport770DeclarationType_IT::Integrative);
}

public void updateSignatoryForeignAddress(boolean _edit)
{
    signatory_SignatoryForeignCountryCode.allowEdit(_edit);
    signatory_SignatoryForeignStateProvinceCounty.allowEdit(_edit);
    signatory_SignatoryForeignPlaceOfResidence.allowEdit(_edit);
    signatory_SignatoryForeignAddress.allowEdit(_edit);
    signatory_ForeignFiscalCode.allowEdit(_edit);
}

public int active()
{
    int ret;
    ret = super();
    element.showInactiveAddressBar();
    element.updateSignatoryForeignAddress(taxReport770Table_IT.IsSignatoryLivingAbroad);
    taxReport770Table_IT_LegalAddrChangeDate.allowEdit(taxReport770Table_IT.LegalAddrChanged);
    taxReport770Table_IT_FiscalAddrChangeDate.allowEdit(taxReport770Table_IT.FiscalAddrChanged);
    taxReport770Table_IT_ds.object(fieldNum(TaxReport770Table_IT, Year)).allowEdit(! taxReport770Table_IT.Exported);
    taxReport770Table_IT_Year_Detials.allowEdit();
    if (taxReport770Table_IT.SignatoryRole == WriterRole::BankruptcyCurator ||
        taxReport770Table_IT.SignatoryRole == WriterRole::CommissionedLiquidator)
    {
        reportInfo1_BankruptcyDate.allowEdit(true);
    }
    else
    {
        reportInfo1_BankruptcyDate.allowEdit(false);
    }
    element.enableCorrectedDeclaration();
    element.updateDeclarer();
    tmpTaxReport770Total_IT.setTmpData(TaxReport770TransHandler_IT::calcCompanyTotal(taxReport770Table_IT.ReportId));
    tmpTaxReport770Total_IT_ds.research();
    TaxReport770Trans_IT_ds.executeQuery();
    TaxReport770VendTotal_IT_ds.executeQuery();
    TaxReport770TaxPayments_ds.executeQuery();
    return ret;
}

public void executeQuery()
{
    legalPostalAddress_ds.validTimeStateUpdate(ValidTimeStateUpdate::Correction);
    legalPostalAddress_ds.query().validTimeStateDateTimeRange(DateTimeUtil::minValue(), DateTimeUtil::maxValue());
    fiscalPostalAddress_ds.validTimeStateUpdate(ValidTimeStateUpdate::Correction);
    fiscalPostalAddress_ds.query().validTimeStateDateTimeRange(DateTimeUtil::minValue(), DateTimeUtil::maxValue());

    super();
}

