public void delete()
{
    boolean keepSuspendedPaymentsPrevPeriod = false;

    if (TaxReport770TaxPaymentsV2_IT::existSuspendedPaymentsFromPrevPeriod(taxReport770Table_IT.ReportId) &&
        Box::yesNo("@ApplicationSuite_Localization:SuspendedTaxPaymentsDeletionWarning", DialogButton::Ok) == DialogButton::No)
    {
        keepSuspendedPaymentsPrevPeriod = true;
    }

    TaxReport770TransHandler_IT::updateVendTotal(taxReport770Trans_IT, taxReport770Trans_IT.orig(), true);
    super();
    TaxReport770TransHandler_IT::deleteVendTotalWithoutTransactions(taxReport770Table_IT.ReportId);
    TaxReport770TransHandler_IT::calcCompanyTotal(taxReport770Table_IT.ReportId);

    if (keepSuspendedPaymentsPrevPeriod)
    {
        TaxReport770TaxPaymentsV2_IT::reCalculateVendTaxPaymentKeepingSuspendedPaymFromPrevPeriod(taxReport770Table_IT.ReportId);
    }
    else 
    {
        TaxReport770TaxPaymentsV2_IT::reCalculateVendTaxPayment(taxReport770Table_IT.ReportId);
    }

    taxReport770VendTotal_IT_ds.research(true);
    taxReport770Table_IT_ds.research(true);
    taxReport770TaxPayments_ds.research(true);
    tmpTaxReport770Total_IT_ds.research(true);            
}

public void write()
{
    TaxReport770TransHandler_IT::updateVendTotal(taxReport770Trans_IT, taxReport770Trans_IT.orig());
    TaxReport770TransHandler_IT::calcCompanyTotal(taxReport770Table_IT.ReportId);
    TaxReport770TaxPaymentsV2_IT::updateTotal(taxReport770Trans_IT, taxReport770Trans_IT.orig());
    super();
    taxReport770VendTotal_IT_ds.research(true);
    taxReport770Table_IT_ds.research(true);
    taxReport770TaxPayments_ds.research(true);
    tmpTaxReport770Total_IT_ds.research(true);
}

